import React from 'react';

const CartItem = (item) => {
    return (
        <div className="container">
            <div className="cartItem__content">
                <img src={item.img} alt=""/>
                <h1 className="cartItem__title">{item.title}</h1>
            </div>

        </div>
    );
};

export default CartItem;
